`$injector` is used to retrieve object instances as defined by
{@link auto.$provide provider}, instantiate types, invoke methods,
and load modules.

The following always holds true:

```js
  var $injector = angular.injector();
  expect($injector.get('$injector')).toBe($injector);
  expect($injector.invoke(function($injector) {
    return $injector;
  })).toBe($injector);
```

# Injection Function Annotation

JavaScript does not have annotations, and annotations are needed for dependency injection. The
following are all valid ways of annotating function with injection arguments and are equivalent.

```js
  // inferred (only works if code not minified/obfuscated)
  $injector.invoke(function(serviceA){});

  // annotated
  function explicit(serviceA) {};
  explicit.$inject = ['serviceA'];
  $injector.invoke(explicit);

  // inline
  $injector.invoke(['serviceA', function(serviceA){}]);
```

## Inference

In JavaScript calling `toString()` on a function returns the function definition. The definition
can then be parsed and the function arguments can be extracted. This method of discovering
annotations is disallowed when the injector is in strict mode.
*NOTE:* This does not work with minification, and obfuscation tools since these tools change the
argument names.

## `$inject` Annotation
By adding an `$inject` property onto a function the injection parameters can be specified.

## Inline
As an array of injection names, where the last item in the array is the function to call.

Returns an array of service names which the function is requesting for injection. This API is
used by the injector to determine which services need to be injected into the function when the
function is invoked. There are three ways in which the function can be annotated with the needed
dependencies.

# Argument names

The simplest form is to extract the dependencies from the arguments of the function. This is done
by converting the function into a string using `toString()` method and extracting the argument
names.
```js
  // Given
  function MyController($scope, $route) {
    // ...
  }

  // Then
  expect(injector.annotate(MyController)).toEqual(['$scope', '$route']);
```

You can disallow this method by using strict injection mode.

This method does not work with code minification / obfuscation. For this reason the following
annotation strategies are supported.

# The `$inject` property

If a function has an `$inject` property and its value is an array of strings, then the strings
represent names of services to be injected into the function.
```js
  // Given
  var MyController = function(obfuscatedScope, obfuscatedRoute) {
    // ...
  }
  // Define function dependencies
  MyController['$inject'] = ['$scope', '$route'];

  // Then
  expect(injector.annotate(MyController)).toEqual(['$scope', '$route']);
```

# The array notation

It is often desirable to inline Injected functions and that's when setting the `$inject` property
is very inconvenient. In these situations using the array notation to specify the dependencies in
a way that survives minification is a better choice:

```js
  // We wish to write this (not minification / obfuscation safe)
  injector.invoke(function($compile, $rootScope) {
    // ...
  });

  // We are forced to write break inlining
  var tmpFn = function(obfuscatedCompile, obfuscatedRootScope) {
    // ...
  };
  tmpFn.$inject = ['$compile', '$rootScope'];
  injector.invoke(tmpFn);

  // To better support inline function the inline annotation is supported
  injector.invoke(['$compile', '$rootScope', function(obfCompile, obfRootScope) {
    // ...
  }]);

  // Therefore
  expect(injector.annotate(
     ['$compile', '$rootScope', function(obfus_$compile, obfus_$rootScope) {}])
   ).toEqual(['$compile', '$rootScope']);
```

example:
The following example shows how to create a simple event tracking service and register it using
{@link auto.$provide#provider $provide.provider()}.

```js
 // Define the eventTracker provider
 function EventTrackerProvider() {
   var trackingUrl = '/track';

   // A provider method for configuring where the tracked events should been saved
   this.setTrackingUrl = function(url) {
     trackingUrl = url;
   };

   // The service factory function
   this.$get = ['$http', function($http) {
     var trackedEvents = {};
     return {
       // Call this to track an event
       event: function(event) {
         var count = trackedEvents[event] || 0;
         count += 1;
         trackedEvents[event] = count;
         return count;
       },
       // Call this to save the tracked events to the trackingUrl
       save: function() {
         $http.post(trackingUrl, trackedEvents);
       }
     };
   }];
 }

 describe('eventTracker', function() {
   var postSpy;

   beforeEach(module(function($provide) {
     // Register the eventTracker provider
     $provide.provider('eventTracker', EventTrackerProvider);
   }));

   beforeEach(module(function(eventTrackerProvider) {
     // Configure eventTracker provider
     eventTrackerProvider.setTrackingUrl('/custom-track');
   }));

   it('tracks events', inject(function(eventTracker) {
     expect(eventTracker.event('login')).toEqual(1);
     expect(eventTracker.event('login')).toEqual(2);
   }));

   it('saves to the tracking url', inject(function(eventTracker, $http) {
     postSpy = spyOn($http, 'post');
     eventTracker.event('login');
     eventTracker.save();
     expect(postSpy).toHaveBeenCalled();
     expect(postSpy.mostRecentCall.args[0]).not.toEqual('/track');
     expect(postSpy.mostRecentCall.args[0]).toEqual('/custom-track');
     expect(postSpy.mostRecentCall.args[1]).toEqual({ 'login': 1 });
   }));
 });
```

Here is an example of registering a service
```js
  $provide.factory('ping', ['$http', function($http) {
    return function ping() {
      return $http.send('/ping');
    };
  }]);
```
You would then inject and use this service like this:
```js
  someModule.controller('Ctrl', ['ping', function(ping) {
    ping();
  }]);
```

classitems.description:
Register a **service constructor**, which will be invoked with `new` to create the service
instance.
This is short for registering a service where its provider's `$get` property is a factory
function that returns an instance instantiated by the injector from the service constructor
function.

Internally it looks a bit like this:

```
{
  $get: function() {
    return $injector.instantiate(constructor);
  }
}
```


You should use {@link auto.$provide#service $provide.service(class)} if you define your service
as a type/class.

example:
Here is an example of registering a service using
{@link auto.$provide#service $provide.service(class)}.
```js
  var Ping = function($http) {
    this.$http = $http;
  };

  Ping.$inject = ['$http'];

  Ping.prototype.send = function() {
    return this.$http.get('/ping');
  };
  $provide.service('ping', Ping);
```
You would then inject and use this service like this:
```js
  someModule.controller('Ctrl', ['ping', function(ping) {
    ping.send();
  }]);
```

Here are some examples of creating value services.
```js
  $provide.value('ADMIN_USER', 'admin');

  $provide.value('RoleLookup', { admin: 0, writer: 1, reader: 2 });

  $provide.value('halfOf', function(value) {
    return value / 2;
  });
```

Here a some examples of creating constants:
```js
  $provide.constant('SHARD_HEIGHT', 306);

  $provide.constant('MY_COLOURS', ['red', 'blue', 'grey']);

  $provide.constant('double', function(value) {
    return value * 2;
  });
```

Here we decorate the {@link ng.$log $log} service to convert warnings to errors by intercepting
calls to {@link ng.$log#error $log.warn()}.
```js
  $provide.decorator('$log', ['$delegate', function($delegate) {
    $delegate.warn = $delegate.error;
    return $delegate;
  }]);
```

classitems.description:
Registers a new injectable animation factory function. The factory function produces the
animation object which contains callback functions for each event that is expected to be
animated.

  * `eventFn`: `function(element, ... , doneFunction, options)`
  The element to animate, the `doneFunction` and the options fed into the animation. Depending
  on the type of animation additional arguments will be injected into the animation function. The
  list below explains the function signatures for the different animation methods:

  - setClass: function(element, addedClasses, removedClasses, doneFunction, options)
  - addClass: function(element, addedClasses, doneFunction, options)
  - removeClass: function(element, removedClasses, doneFunction, options)
  - enter, leave, move: function(element, doneFunction, options)
  - animate: function(element, fromStyles, toStyles, doneFunction, options)

  Make sure to trigger the `doneFunction` once the animation is fully complete.

```js
  return {
    //enter, leave, move signature
    eventFn : function(element, done, options) {
      //code to run the animation
      //once complete, then run done()
      return function endFunction(wasCancelled) {
        //code to cancel the animation
      }
    }
  }
```

Sets up an event listener to fire whenever the animation event (enter, leave, move, etc...)
    has fired on the given element or among any of its children. Once the listener is fired, the provided callback
    is fired with the following params:
```js
 $animate.on('enter', container,
    function callback(element, phase) {
      // cool we detected an enter animation within the container
    }
 );
 ```

Deregisters an event listener based on the event which has been associated with the provided element. This method
 can be used in three different ways depending on the arguments:
```js
 // remove all the animation event listeners listening for `enter`
 $animate.off('enter');
// remove all the animation event listeners listening for `enter` on the given element and its children
 $animate.off('enter', container);
// remove the event listener function provided by `callback` that is set
 // to listen for `enter` on the given `container` as well as its children
 $animate.off('enter', container, callback);
 ```

Used to get and set whether animations are enabled or not on the entire application or on an element and its children. This
 function can be called in four ways:
```js
 // returns true or false
 $animate.enabled();
// changes the enabled state for all animations
 $animate.enabled(false);
 $animate.enabled(true);
// returns true or false if animations are enabled for an element
 $animate.enabled(element);
// changes the enabled state for an element and its children
 $animate.enabled(element, true);
 $animate.enabled(element, false);
 ```

Performs an inline animation on the element which applies the provided to and from CSS styles to the element.
If any detected CSS transition, keyframe or JavaScript matches the provided className value, then the animation will take
on the provided styles. For example, if a transition animation is set for the given classNamem, then the provided `from` and
`to` styles will be applied alongside the given transition. If the CSS style provided in `from` does not have a corresponding
style in `to`, the style in `from` is applied immediately, and no animation is run.
If a JavaScript animation is detected then the provided styles will be given in as function parameters into the `animate`
method (or as part of the `options` parameter):

```js
ngModule.animation('.my-inline-animation', function() {
  return {
    animate : function(element, from, to, done, options) {
      //animation
      done();
    }
  }
});
```

Factory that constructs {@link $cacheFactory.Cache Cache} objects and gives access to
them.

```js

 var cache = $cacheFactory('cacheId');
 expect($cacheFactory.get('cacheId')).toBe(cache);
 expect($cacheFactory.get('noSuchCacheId')).not.toBeDefined();

 cache.put("key", "value");
 cache.put("another key", "another value");

 // We've specified no options on creation
 expect(cache.info()).toEqual({id: 'cacheId', size: 2});

```

A cache object used to store and retrieve data, primarily used by
{@link $http $http} and the {@link ng.directive:script script} directive to cache
templates and other data.

```js
 angular.module('superCache')
   .factory('superCache', ['$cacheFactory', function($cacheFactory) {
     return $cacheFactory('super-cache');
   }]);
```

Example test:

```js
 it('should behave like a cache', inject(function(superCache) {
   superCache.put('key', 'value');
   superCache.put('another key', 'another value');

   expect(superCache.info()).toEqual({
     id: 'super-cache',
     size: 2
   });

   superCache.remove('another key');
   expect(superCache.get('another key')).toBeUndefined();

   superCache.removeAll();
   expect(superCache.info()).toEqual({
     id: 'super-cache',
     size: 0
   });
 }));
```

